import React from "react";

const Total = ({parts}) => {
    const total = parts.reduce((s, p) => s + p);
    console.log(total);

    return <p>Total of {
        parts[0].exercise + parts[1].exercise + parts[2].exercise + parts[3].exercise
    } exercises</p>
}

export default Total;
